/*Table structure for table `account_bill` */

DROP TABLE IF EXISTS `account_bill`;

CREATE TABLE `account_bill` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `bill_no` varchar(128) NOT NULL DEFAULT '',
  `company_id` bigint(20) DEFAULT '0',
  `branch_id` bigint(20) DEFAULT '0',
  `account_type` int(11) DEFAULT '0',
  `state` decimal(1,0) NOT NULL DEFAULT '0',
  `not_pay_fee` decimal(18,2) DEFAULT '0.00',
  `regulated_fee` decimal(18,2) DEFAULT '0.00',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

