type=\'text\' value=\'${c1?if_exists?html}\' /></p></td><td><p><input name=\'c2\' size=\'4\' type=\'text\' value=\'${c2?if_exists?html}\' /></p></td><td><p><input name=\'c3\' size=\'4\' type=\'text\' value=\'${c3?if_exists?html}\' /></p></td><td><p><input name=\'c4\' size=\'4\' type=\'text\' value=\'${c4?if_exists?html}\' /></p></td><td><p><input name=\'c5\' size=\'4\' type=\'text\' value=\'${c5?if_exists?html}\' /></p></td><td><p><input name=\'d1\' size=\'4\' type=\'text\' value=\'${d1?if_exists?html}\' /></p></td><td><p><input name=\'d2\' size=\'4\' type=\'text\' value=\'${d2?if_exists?html}\' /></p></td><td><p><input name=\'d3\' size=\'4\' type=\'text\' value=\'${d3?if_exists?html}\' /></p></td><td><p><input name=\'d4\' size=\'4\' type=\'text\' value=\'${d4?if_exists?html}\' /></p></td><td><p><input name=\'e1\' size=\'4\' type=\'text\' value=\'${e1?if_exists?html}\' /></p></td><td><p><input name=\'e2\' size=\'4\' type=\'text\' value=\'${e2?if_exists?html}\' /></p></td><td><p><input name=\'e3\' size=\'4\' type=\'text\' value=\'${e3?if_exists?html}\' /></p></td><td><p><input name=\'e4\' size=\'4\' type=\'text\' value=\'${e4?if_exists?html}\' /></p></td></tr><tr><td colspan=\'20\'><p>&nbsp;</p><p>填报说明：</p><p>一、合计（A）：填报至统计截止期的本机构的人员总数。</p><p>二、人数：</p><p>在编人员：分别按照价格认证机构编制内及其它具有价格主管部门编制的实有人数填报在B1、B2栏内。</p><p>聘用人员：按照经价格主管部门或价格认证机构人事部门认可的并签订三年以上的工作合同的人员（B3）；以及没有经过价格主管部门或价格认证机构人事部门认可的签订合同少于三年的人员（B4）分别来进行统计。</p><p>临时（借用）人员（B5）：特指外聘的临时工，或者工作关系不在本单位且无长期聘用合同的借调人员等。</p><p>三、表内各栏目关系</p><p>A=B1+B2+B3+B4+B5=C1+C2+C3+C4+C5=D1+D2+D3+D4=E1+E2+E3+E4</p></td></tr></tbody></table></form></div></body></html>');

/*Table structure for table `ck_finder` */

DROP TABLE IF EXISTS `ck_finder`;

CREATE TABLE `ck_finder` (
  `ID` varchar(32) NOT NULL,
  `ATTACHMENT` varchar(255) DEFAULT NULL,
  `IMAGE` varchar(255) DEFAULT NULL,
  `REMARK` longtext,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `ck_finder` */

/*Table structure for table `cod_carrier` */

DROP TABLE IF EXISTS `cod_carrier`;

CREATE TABLE `cod_carrier` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `carrier_name` varchar(64) NOT NULL DEFAULT '' COMMENT '承运商名称',
  `carrier_code` varchar(64) NOT NULL DEFAULT '' COMMENT '承运商编号',
  `cod_org_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '站点',
  `user_code` varchar(128) NOT NULL DEFAULT '' COMMENT '站长',
  `query_count` int(11) DEFAULT '0' COMMENT '最大查询数量',
  `resend_count` int(11) DEFAULT '0' COMMENT '失败重发次数',
  `private_key` varchar(128) DEFAULT '' COMMENT '密钥',
  `is_asynchronous` decimal(1,0) DEFAULT '0' COMMENT '是否异步回传',
  `asynchronous_url` varchar(128) DEFAULT '' COMMENT '异步回传URL',
  `is_open` decimal(1,0) DEFAULT '0' COMMENT '是否对接',
  `phone` varchar(20) DEFAULT '' COMMENT '查单电话',
  `order_prefix` varchar(20) DEFAULT '' COMMENT '订单号前缀',
  `state` tinyint(4) DEFAULT '1' COMMENT '承运商状态',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `cod_carrier` */

/*Table structure for table `cod_code_def` */

DROP TABLE IF EXISTS `cod_code_def`;

CREATE TABLE `cod_code_def` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `cod_code_type_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '数据字典类型',
  `code_value` varchar(32) DEFAULT '' COMMENT '代码值',
  `display_value` varchar(128) DEFAULT '' COMMENT '编码内容（中文）',
  `display_value_en` varchar(128) DEFAULT '' COMMENT '编码内容（英文）',
  `modifiable` decimal(1,0) DEFAULT '1' COMMENT '允许修改',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=66 DEFAULT CHARSET=utf8;

/*Data for the table `cod_code_def` */

/*Table structure for table `cod_code_type` */

DROP TABLE IF EXISTS `cod_code_type`;

CREATE TABLE `cod_code_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `code_name` varchar(64) NOT NULL DEFAULT '' COMMENT '类型名称',
  `code_type` varchar(64) NOT NULL DEFAULT '' COMMENT '类型编码',
  `code_grade` tinyint(4) DEFAULT '0' COMMENT '类型等级',
  `code_width` tinyint(4) DEFAULT '0' COMMENT '编码宽度',
  `code_desc` varchar(128) DEFAULT '' COMMENT '类型描述',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

