/*Table structure for table `cod_customer` */

DROP TABLE IF EXISTS `cod_customer`;

CREATE TABLE `cod_customer` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `customer_full_name` varchar(64) DEFAULT NULL COMMENT '客户全称',
  `customer_name` varchar(100) DEFAULT '' COMMENT '客户名称',
  `customer_code` varchar(50) DEFAULT '' COMMENT '客户编码',
  `business_type` varchar(64) DEFAULT '0' COMMENT '业务类型',
  `contacts` text COMMENT '联系人',
  `invoce` varchar(256) DEFAULT '' COMMENT '发票抬头',
