/*Table structure for table `cod_grid_tab_config` */

DROP TABLE IF EXISTS `cod_grid_tab_config`;

CREATE TABLE `cod_grid_tab_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sort_no` tinyint(4) DEFAULT '0' COMMENT '排序号',
  `element_code` varchar(64) DEFAULT '' COMMENT '所属元素',
  `tab_title` varchar(64) DEFAULT '' COMMENT '页签名称',
  `grid_id` varchar(64) DEFAULT '' COMMENT 'gridId',
  `auto_fresh` decimal(1,0) DEFAULT '1' COMMENT '是否点击页签刷新',
  `columns` varchar(2048) DEFAULT '' COMMENT '显示字段',
  `status` decimal(1,0) DEFAULT '0',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '页签类型',
  `remark` varchar(512) DEFAULT '',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8;

