/*Table structure for table `cod_handover_template` */

DROP TABLE IF EXISTS `cod_handover_template`;

CREATE TABLE `cod_handover_template` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `template_name` varchar(64) NOT NULL DEFAULT '' COMMENT '模板名称',
  `template_type` int(11) NOT NULL DEFAULT '0' COMMENT '模板类型',
  `detail` varchar(10240) DEFAULT '' COMMENT '字段明显',
  `show_num` int(11) DEFAULT '0' COMMENT '每行显示订单数',
  `view_type` int(11) DEFAULT '0' COMMENT '显示类型',
  `paper_type` int(11) DEFAULT '0' COMMENT '纸张类型',
  `print_direction` int(11) DEFAULT '0' COMMENT '打印方向',
  `predefine_filed` varchar(64) DEFAULT NULL COMMENT '预定义字段',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `cod_handover_template` */

/*Table structure for table `cod_message_def` */

DROP TABLE IF EXISTS `cod_message_def`;

CREATE TABLE `cod_message_def` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(128) DEFAULT NULL COMMENT '提示名称',
  `function_node` int(11) DEFAULT NULL COMMENT '功能节点(枚举)',
  `is_hint` decimal(1,0) DEFAULT '0' COMMENT '是否文字提示',
  `hint_msg` varchar(128) DEFAULT NULL COMMENT '文字提示内容',
  `is_voice` decimal(1,0) DEFAULT '0' COMMENT '是否声音提示',
  `voice_code` varchar(64) DEFAULT NULL COMMENT '声音编码',
  `message_invoker` varchar(512) DEFAULT NULL COMMENT '触发条件(枚举)',
  `priority_level` decimal(18,2) DEFAULT NULL COMMENT '优先级',
  `is_dymic_show` decimal(1,0) DEFAULT NULL COMMENT '是否动态显示',
  `show_order` decimal(18,2) DEFAULT NULL COMMENT '显示顺序',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=112 DEFAULT CHARSET=utf8;

/*Data for the table `cod_message_def` */

/*Table structure for table `cod_note_tab_config` */

DROP TABLE IF EXISTS `cod_note_tab_config`;

CREATE TABLE `cod_note_tab_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `element_code` varchar(64) DEFAULT '' COMMENT '所属元素',
  `tab_title` varchar(64) DEFAULT '' COMMENT '页签名称',
  `sort_no` tinyint(4) DEFAULT '0' COMMENT '排序号',
  `note_id` varchar(64) DEFAULT '' COMMENT 'gridId',
  `auto_fresh` decimal(1,0) DEFAULT '1' COMMENT '是否点击页签刷新',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '看板类型',
  `status` decimal(1,0) DEFAULT '0',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8;

