/*Table structure for table `cod_order_filed` */

DROP TABLE IF EXISTS `cod_order_filed`;

CREATE TABLE `cod_order_filed` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `filed_name` varchar(50) NOT NULL DEFAULT '' COMMENT '导出字段名称',
  `filed_code` varchar(50) NOT NULL DEFAULT '' COMMENT '导出字段代码',
  `filed_type` varchar(128) NOT NULL DEFAULT '' COMMENT '字段类型',
  `validate_rule` varchar(512) DEFAULT '' COMMENT '校验规则',
  `template_type` int(11) NOT NULL DEFAULT '0' COMMENT '模板类型',
  `entity_alias` varchar(4) DEFAULT '' COMMENT '实体类别名',
  `export_setting` varchar(512) DEFAULT '' COMMENT '导出设置',
  `sort_no` decimal(18,2) DEFAULT '0.00' COMMENT '导入界面字段排序',
  `extra_rule` varchar(512) DEFAULT '' COMMENT '转换规划',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=629 DEFAULT CHARSET=utf8;

