/*Table structure for table `cod_org` */

DROP TABLE IF EXISTS `cod_org`;

CREATE TABLE `cod_org` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `org_type` int(11) NOT NULL DEFAULT '0' COMMENT '机构类型',
  `org_name` varchar(64) NOT NULL DEFAULT '' COMMENT '机构名称',
  `org_code` varchar(64) NOT NULL DEFAULT '' COMMENT '机构编码',
  `org_leader` varchar(64) NOT NULL DEFAULT '' COMMENT '负责人',
  `org_phone` varchar(64) DEFAULT '' COMMENT '电话',
  `org_mobile` varchar(64) DEFAULT '' COMMENT '手机',
  `org_fax` varchar(64) DEFAULT '' COMMENT '传真',
  `org_email` varchar(64) DEFAULT '' COMMENT '邮箱',
  `org_province` varchar(64) DEFAULT '' COMMENT '省份',
  `org_address` varchar(128) DEFAULT '' COMMENT '地址',
  `parent_org_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '上级机构',
  `org_city` varchar(64) DEFAULT '' COMMENT '城市',
  `org_country` varchar(64) DEFAULT '' COMMENT '区/县',
  `org_street` varchar(256) DEFAULT '' COMMENT '乡镇/街道',
  `settlement_type` int(11) NOT NULL DEFAULT '0' COMMENT '结算类型（枚举）',
  `overlimit_amount` decimal(18,2) DEFAULT '0.00' COMMENT '超额设置',
  `credit_amount` decimal(18,2) DEFAULT '0.00' COMMENT '信用额度',
  `oneday_prescription` bigint(20) DEFAULT '0' COMMENT '一日达时效',
  `twoday_prescription` bigint(20) DEFAULT '0' COMMENT '二日达时效',
  `site_type` int(11) DEFAULT '0' COMMENT '站点类型',
  `transfer_org_id` bigint(20) DEFAULT '0' COMMENT '中转库',
  `reject_org_id` bigint(20) DEFAULT '0' COMMENT '退货库',
  `settlement_org_id` bigint(20) DEFAULT '0' COMMENT '结算类型',
  `fanancial_org_id` bigint(20) DEFAULT '0' COMMENT '交款财务',
  `distrubute_remind_type` int(11) NOT NULL DEFAULT '0' COMMENT '分拣操作提示方式',
  `withhold_remaining` decimal(18,2) DEFAULT '0.00' COMMENT '预扣账户余额',
  `withhold_debt` decimal(18,2) DEFAULT '0.00' COMMENT '预扣欠款',
  `deduct_remaining` decimal(18,2) DEFAULT '0.00' COMMENT '实扣账户余额',
  `deduct_debt` decimal(18,2) DEFAULT '0.00' COMMENT '实扣欠款',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '站点状态',
  `valuable_limit` decimal(18,2) DEFAULT '0.00' COMMENT '高价额度',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

