/*Table structure for table `cod_role_data` */

DROP TABLE IF EXISTS `cod_role_data`;

CREATE TABLE `cod_role_data` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `role_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '角色',
  `data_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '数据',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `cod_role_data` */

/*Table structure for table `cod_role_user` */

DROP TABLE IF EXISTS `cod_role_user`;

CREATE TABLE `cod_role_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `role_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '角色',
  `user_code` varchar(64) DEFAULT NULL COMMENT '用户编码',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `cod_role_user` */

/*Table structure for table `cod_set_order_flow` */

DROP TABLE IF EXISTS `cod_set_order_flow`;

CREATE TABLE `cod_set_order_flow` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `node_id` int(11) DEFAULT '0' COMMENT '当前节点',
  `next_id` int(11) DEFAULT '0' COMMENT '下一节点',
  `cod_customer_id` int(11) DEFAULT '0' COMMENT '客户',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_office` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_office` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1509 DEFAULT CHARSET=utf8;

