/*Table structure for table `cod_sms` */

DROP TABLE IF EXISTS `cod_sms`;

CREATE TABLE `cod_sms` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `receivers` varchar(64) DEFAULT '' COMMENT '收件人姓名',
  `mobile` varchar(64) NOT NULL DEFAULT '' COMMENT '收件人手机',
  `content` varchar(512) NOT NULL DEFAULT '' COMMENT '短信内容',
  `send_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '发送状态',
  `error_msg` varchar(512) DEFAULT '' COMMENT '失败原因',
  `retry_count` int(11) NOT NULL DEFAULT '0' COMMENT '重试次数',
  `sender` varchar(64) DEFAULT '' COMMENT '发送人',
  `send_ip` varchar(64) DEFAULT '' COMMENT '发送人IP',
  `sms_path` int(11) DEFAULT '0' COMMENT '短信渠道',
  `cod_customer_id` int(11) DEFAULT '0' COMMENT '客户',
  `order_no` varchar(64) DEFAULT '',
  `send_time` datetime DEFAULT NULL COMMENT '发送时间',
  `send_way` int(11) DEFAULT '0' COMMENT '发送方式',
  `is_deleted` decimal(1,0) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `cod_sms` */

