  `is_default` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否默认',
  `left_count` int(11) NOT NULL DEFAULT '0' COMMENT '剩余短信数',
  `is_deleted` decimal(1,0) DEFAULT '0',
