  `smh_waitfortransit_num` int(11) DEFAULT '0' COMMENT '上门换待中转',
  `ps_lost_num` int(11) DEFAULT '0' COMMENT '配送货物丢失',
  `smt_lost_num` int(11) DEFAULT '0' COMMENT '上门退货物丢失 ',
