/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '父级主建',
  `view_code` varchar(64) NOT NULL DEFAULT '',
  `title` varchar(128) NOT NULL DEFAULT '' COMMENT '标题',
  `title_en` varchar(128) DEFAULT '' COMMENT '英文标题',
  `menu_url` varchar(256) NOT NULL DEFAULT '' COMMENT '菜单链接',
  `menu_seq` int(11) NOT NULL DEFAULT '0' COMMENT '菜单序号',
  `menu_level` int(11) NOT NULL DEFAULT '0' COMMENT '菜单层级',
  `css_name` varchar(32) DEFAULT '' COMMENT '样式名称',
  `id_code` varchar(256) DEFAULT '' COMMENT '层级规则编码',
  `remark` varchar(512) DEFAULT '',
  `is_valid` tinyint(4) NOT NULL DEFAULT '0',
  `is_deleted` tinyint(4) DEFAULT '0',
  `created_by_user` varchar(64) DEFAULT '',
  `created_dtm_loc` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_time_zone` varchar(64) DEFAULT '',
  `updated_by_user` varchar(64) DEFAULT '',
  `updated_dtm_loc` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time_zone` varchar(64) DEFAULT '',
  `record_version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10197 DEFAULT CHARSET=utf8;

