/*Table structure for table `sys_role_menu_item` */

DROP TABLE IF EXISTS `sys_role_menu_item`;

CREATE TABLE `sys_role_menu_item` (
  `SYS_ROLE_MENU_ITEM_ID` varchar(50) COLLATE utf8_bin NOT NULL,
  `SYS_ROLE_ID` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `SYS_MENU_ITEM_ID` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `CREATED_BY_USER` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `CREATED_OFFICE` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `CREATED_DTM_LOC` datetime DEFAULT NULL,
  `CREATED_TIME_ZONE` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `UPDATED_BY_USER` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `UPDATED_OFFICE` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `UPDATED_DTM_LOC` datetime DEFAULT NULL,
  `UPDATED_TIME_ZONE` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `RECORD_VERSION` bigint(10) DEFAULT NULL,
  PRIMARY KEY (`SYS_ROLE_MENU_ITEM_ID`),
  KEY `IDX_SYS_MENU_ITEM_ID` (`SYS_MENU_ITEM_ID`),
  KEY `SYS_ROLE_ID` (`SYS_ROLE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

